package org.thirdparty.request.model;

public class SimProfiles {

	private String smsrId;
	private String profileType;
	private String enableProfile;
	private String oemId;
	public String getSmsrId() {
		return smsrId;
	}
	public void setSmsrId(String smsrId) {
		this.smsrId = smsrId;
	}
	public String getProfileType() {
		return profileType;
	}
	public void setProfileType(String profileType) {
		this.profileType = profileType;
	}
	public String getEnableProfile() {
		return enableProfile;
	}
	public void setEnableProfile(String enableProfile) {
		this.enableProfile = enableProfile;
	}
	public String getOemId() {
		return oemId;
	}
	public void setOemId(String oemId) {
		this.oemId = oemId;
	}
	
	
}
